'''Flatpacks''' are pre-packaged [[furniture]] built with the [[Construction]] skill on a [[workbench]] in the [[Workshop]] of a [[player-owned house]]. Flatpacks allow players to install the furniture inside their [[player-owned house]] without the necessary level required to build the furniture from scratch. A hammer is required to install flatpacked furniture. An example would be a level 42 builder adding a [[Costume Room]] to their house and using an [[oak toy box (flatpack)|oak toy box flatpack]] on a [[Toy box space]]. No experience is received when using a flatpack on a building [[hotspot]].

Flatpack items can be created with building mode either on or off. A [[hammer]] and a [[saw]] are needed in your inventory to create flatpack items, and they are always created un-noted. Each flatpack takes 8 game [[tick]]s (4.8 seconds) to create. Creating flatpacks still requires the same amount of materials needed to construct the furniture at the hotspot. The advantage of making flatpack items is that there is no need to enter building mode or remove any furniture from a hotspot to create them.

