==Unobtainable==
Even though pieces of furniture from the [[study]] room cannot be made into a flatpack, the game cache reveals a flatpackable version of them. This may be the result of Jagex deciding that these items should not be made flatpackable for unknown reasons, but did not remove the code for the items before launch.

Upon the release of the [[Grand Exchange]], players were able to submit buy offers for these items, but as they cannot be made in the [[workshop]]'s [[workbench]], the offers were never completed.

When asked about these items in a Q&A stream on [[24 March]] [[2016]]{{CiteVideo|author=Old School RuneScape|title=Monkey Madness 2 New Monster Sneak Peek - Old School RuneScape Q&A|timestamp=07:04|date=24 Mar 2016|site=Youtube|url=op2NIPN7_5I?t=424}}, [[Jagex Moderator]] Mod John C gave the following response:

{{Cquote2|There's a number of flatpacks that exist as objects in the game but you can't actually create them, because they were created when Construction was being developed as a skill way back in... 2005? 6? The flatpacks that exist were scrapped but the objects weren't deleted, so they made it into the live game... we could make them flatpackable, but there's no real benefit to it.|Mod John C, Associate Producer}}

The items were then removed from the [[Grand Exchange]] in [[Update:Bank Placeholders & PID|an update]] on [[14 April]] [[2016]].

